import React from 'react';
import {Menu, Message} from 'semantic-ui-react';

export default () => {
  return (
    <Menu tabular
      size='massive'
    >
      <Menu.Item header
        name='Break Randomizer'
      />
      <Menu.Item
        name='bio'
      />
      <Menu.Item
        name='photos'
      />
    </Menu>
  );
}
